import axios from "axios";
const url = "htpp://localhost:8000/product";

const getProductFromApi = () => {
  const response = axios.get(url);
  const product = response.status === 200 ? JSON.parse(response._bodyInit) : [];
  return product;
};

export const Api = {
  getProductFromApi,
};
